import React, { Component } from 'react';
import Chat from '../Chat/Chat';
import { Switch, Route } from 'react-router-dom';
import Receipt from '../ReceiptView/Receipt'
import Navbar from '../navbar/Navbar';
import Topbar from '../navbar/Topbar';
import ProfileView from '../Profile/ProfileView';
import GroupImage from '../groupImage/GroupImage';
import Calculate from '../Algorithm/Calculate'

class NewHome extends Component {
    render() {

        const testFunc = () => {
            console.log(this.props.currentUser)
        }

        return (
          <div>

            <Topbar />
            <Switch>
            <Route
            path="/Calculate"
            component={(props) => (
              <Calculate {...props} currentUser={this.state.currentUser} />
            )}
          />
              <Route
                exact
                path="/Profile"
                component={(props) => (
                  <ProfileView
                    {...props}
                    currentUser={this.state.currentUser}
                  />
                )}
              />
              <Route
                exact
                path="/chat/:id"
                component={(props) => (
                  <Chat
                    {...props}
                    currentUser={this.state.currentUser}
                    chatID={this.props.currentUser.currentTrip}
                  />
                )}
              />
              <Route
                exact
                path="/home/receipt"
                component={(props) => <Receipt {...props} />}
              />
              <Route
                exact
                path="/home/image"
                component={(props) => <GroupImage {...props} />}
              />
            </Switch>
            <Chat
              currentUser={this.props.currentUser}
              chatID={this.props.currentUser.currentTrip}
            />
            <Navbar/>

            {testFunc()}
          </div>
        );
    }
}

export default NewHome;
